import React from 'react';

interface Props {
    todos: Todo[];
    changeTodos: ChangeTodos;
    supprTodo: SupprTodo;
}

export const Todos: React.FC<Props> = ({ todos, changeTodos, supprTodo }) => {
  return (
    <>
        {todos.map(todo => (
        <li>
            <label style={{ textDecoration: todo.complete ? 'line-through' : undefined }}>
                <input type="checkbox" checked={todo.complete} onClick={() => {changeTodos(todo);}}/> {todo.text}
                <button onClick={() => {supprTodo();}}>Supprimer</button>
            </label>
        </li>
        ))}
    </>
  );
};
